import React from 'react';
import {Text, View, StyleSheet, TouchableOpacity} from 'react-native';
import Item from '../componentes/item';
export default function Home({navigation}){
    return(
        <View>
            
        <TouchableOpacity
        onPress={ () => navigation.navigate('Detail')}>
            <Text>Home</Text>
        </TouchableOpacity>
    </View>
    )
}
